import * as React from "react";
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";


const router = createBrowserRouter(
  [{
     path: "/",
     element:<Home/>
  },
  {
    path: "/Products/:id",
    element:<Products/>
  },
  {
    path: "/Product/:id",
    element:<product/>
  },
])

function App() {
  return (
    <div>
        <RouterProvider router={router} />  
    </div>
  );
}

export default App;
